import React from "react";
import classes from "./Button.module.css";
import ReactTooltip from "react-tooltip";

const button = props => (
  <>
    <button
      className={classes.Button}
      onClick={props.clicked}
      data-tip="Copied"
      event="click"
    >
      Copy
    </button>{" "}
    <ReactTooltip />
  </>
);

export default button;
